import { Component } from '@angular/core';

@Component({
  selector: 'app-os-cpd',
  templateUrl: './os-cpd.component.html',
  styleUrls: ['./os-cpd.component.scss']
})
export class OsCpdComponent {

}
<div class="txt-so">
    <p>Nessa página você encontra suas requisições de ordens de serviço</p>
</div>
<app-botao-filtro  [descricao]="'Todas as ordens'"></app-botao-filtro>
<app-botao-filtro  [descricao]="'Concluídas'" ></app-botao-filtro>
<app-botao-filtro  [descricao]="'Rejeitadas'"></app-botao-filtro>
